css:
atom-text-editor,
:host {
  background-color: #282828;
  color: #f8f8f2;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: rgba(255, 255, 255, 0.1);
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(255, 255, 255, 0.15);
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: rgba(197, 200, 198, 0.2);
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #303030;
  color: #f8f8f2;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #49483e;
  color: #f8f8f2;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #f8f8f2;
}
atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #cccccc;
}
atom-text-editor .invisible,
:host .invisible {
  color: #f8f8f2;
}
atom-text-editor .cursor,
:host .cursor {
  color: #f8f8f0;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #49483e;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #888888;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #ffffff;
}
.comment {
  color: #75715e;
}
.entity.name.type {
  color: #ffd569;
}
.entity.other.inherited-class {
  font-style: italic;
  text-decoration: none;
  color: #a6e22e;
}
.entity.name.function {
  color: #a6e22e;
}
.entity.name.class,
.entity.name.type.class {
  text-decoration: none;
  color: #a6e22e;
}
.entity.name.instance {
  color: #66d9ef;
}
.entity.name.tag {
  color: #f92672;
}
.entity.other.attribute-name {
  color: #a6e22e;
}
.entity.other.attribute-name.parent-selector {
  color: #ffd569;
}
.invalid {
  color: #f8f8f0;
  background-color: #f92672;
}
.invalid.deprecated {
  background-color: #ae81ff;
}
.keyword {
  color: #f92672 !important;
}
.storage {
  color: #f92672;
}
.storage.type {
  font-style: italic;
  color: #66d9ef;
}
.constant.character.escape,
.constant.numeric,
.constant.other.color,
.constant.other.rgb-value,
.constant.other.symbol {
  color: #ae81ff;
}
.variable {
  color: #fd971f;
}
.variable.parameter {
  font-style: italic;
}
.variable.language.python,
.variable.language.js {
  color: #f92672;
}
.string {
  color: #e6db74;
}
.punctuation.definition.comment {
  color: #75715e;
}
.punctuation.definition.string {
  color: #e6db74;
}
.punctuation.definition.parameters {
  color: #f92672;
}
.punctuation.definition.variable,
.punctuation.definition.array {
  color: #f8f8f2;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #66d9ef;
}
.punctuation.definition.bold {
  color: #ffd569;
  font-weight: bold;
}
.punctuation.definition.italic {
  color: #ae81ff;
  font-style: italic;
}
.punctuation.section {
  color: #66d9ef;
}
.punctuation.section.embedded {
  color: #e60657;
}
.punctuation.terminator {
  color: #f92672;
}
.support.class,
.support.type {
  color: #66d9ef;
}
.support.constant,
.support.variable,
.support.function {
  font-style: italic;
  color: #66d9ef;
}
.meta.class {
  color: #ffd569;
}
.meta.link {
  color: #fd971f;
}
.meta.require {
  color: #66d9ef;
}
.meta.selector {
  color: #ae81ff;
}
.meta.separator {
  background-color: #888888;
  color: #f8f8f2;
}
.meta.brace {
  color: #66d9ef;
}
.meta.brace.round {
  color: #f92672;
}
.meta.delimiter {
  color: #fd971f;
}
.meta.structure.value > .string,
.meta.structure.value > .string > .punctuation,
.meta.structure.value > .constant {
  color: #ae81ff;
}
.meta.structure > .punctuation.definition .dictionary,
.meta.structure > .punctuation.definition .array {
  color: #66d9ef;
}
.meta.structure > .punctuation.separator {
  color: #f92672;
}
.none {
  color: #f8f8f2;
}
.markup.bold {
  color: #fd971f;
  font-weight: bold;
}
.markup.changed {
  color: #ae81ff;
}
.markup.deleted {
  color: #f92672;
}
.markup.italic {
  color: #ae81ff;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #66d9ef;
}
.markup.inserted {
  color: #a6e22e;
}
.markup.list {
  color: #f92672;
}
.markup.quote {
  color: #fd971f;
}
.markup.raw.inline {
  color: #a6e22e;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #a6e22e;
  font-weight: bold;
}
.source.gfm .markup.underline {
  color: #e6db74;
  text-decoration: underline;
}
.source.gfm .bold {
  font-weight: bold;
}
.source.gfm .italic {
  font-style: italic;
}
.source.gfm .raw {
  color: #66d9ef;
}
.source.gfm .variable.list {
  color: #f92672;
  font-weight: bold;
}
.source.gfm .link {
  color: #cccccc;
}
.source.gfm .link .entity {
  color: #ae81ff;
}
atom-text-editor[mini] .scroll-view,
:host([mini]) .scroll-view {
  padding-left: 1px;
}
.leading-whitespace,
.trailing-whitespace {
  display: inline-block;
}
